public XDR serialize(XDR out, int xid, Verifier verifier) {
  super.serialize(out, xid, verifier);
  fileWcc.serialize(out);
  if (getStatus() == Nfs3Status.NFS3_OK) {
    out.writeInt(count);
    out.writeInt(stableHow.getValue());
    out.writeLongAsHyper(verifer);
  }
  return out;
}
